import TextField from '@mui/material/TextField';
import styled from "styled-components"


const Container = styled.div`
position: relative;
width: 500px;
display: flex;
justify-content: center;
align-items: center;
flex-direction: column;

`

function Form(params) {
    return(
        <Container>

            <TextField  autoComplete="on" type="text" id="standard-basic" label="Nome" variant="standard" />
            <TextField autoComplete="on" type="email" id="standard-basic" label="E-mail" variant="standard" />
        </Container>

    )
}

export default Form;
